import React, {useState} from 'react'

const [count, setCount] = useState(0);

const App = () => {
  return (<div>
    <p>You clicked {count} times</p>
    <button onClick={() => setCount(count + 1)}>Click THIS</button>
  </div>
  )
}
export default App
